text:
@nysuri My armchair is a parental hand-me-down. Scant decision needed there.
My sofa is a sofa-bed. Choice of these with a comfy bed and removable covers was limited.
Decent guest sleeping was MY first priority.

@Hopkins_Alison I have a tame local Euronics dealer/fixer.
Seem fair value.
Good fixers!

@AnnaBatchelor Yup!
Seems it was a widespread problem on desktops.
Partner had trouble too but spends much less time on  Twitter.

@HeldinEU @helen_a15 Hope they've been tasty calories!
I don't like savoury pastry anything like enough to justify the Calories.
Cake and chocolate are another matter but I prefer GOOD small portions of these.

@HeldinEU Self-transfer is fine for able-bodied, alert folk, with only hand baggage.
Nightmare for others.
Cheap and nasty!

@DrLindaDykes It's a challenge!
My Stockholm uncle was not buried the same day as his death was unexpected. Travel for me was simpler, as I worked at Hillingdon, a local bus ride from LHR.
But it was 1 August...

@DrLindaDykes Not the Jewish refugee, who always has instant access to her passport, evidently!
(I'm sure you had towel access sooner!)
International family funerals have mandated same day travel for me more than once!

@drokane @EM_RESUS I was a surgical SHO in Shetland when a chap from the oil rigs was transferred with 'upper abdo pain'.
ECG a bit like that, CPK (retrospective) through the roof.
No happy ending.

@quality_nguyen @choo_ek I cryo'd &gt;20 warts on my own foot when boss was away… (medic culture…)

Ibuprofen + chocolate biscuits are my self-medication.
Choc biscuits seem to potentiate 'Vitamin I'...

@dyson123 @HeldinEU @bean0509 My first MS symptoms were in 1990 and not investigated.
I've had secondary progressive MS since 2001 but have been clinically pretty static since 2008.
I'm continent, not very mobile but cognitively OK (I kid myself).

@OrthopodReg An upmarket, pricy chicken is cheaper and more tasty.
There are MANY better options for a festive meal.
Always

@dyson123 @HeldinEU @bean0509 All my other reflexes are very brisk and were quite brisk before I developed MS.
My left ankle jerk is absent.
Totally.

@dyson123 @HeldinEU @bean0509 It wasn't.
Nobody ever investigated my absent ankle jerk.
The other features were/are tucked under my nappy/pants.

@HeldinEU @bean0509 Indeed.
I have three clinical features but nobody has ever fingered my bottom to confirm/refute.
It's hardly something I shout from the rooftops!

@EdanStarforth I bet they don't have mince pies in March either!
They are unavailable after 26 December most years...
Supermarkets stock LOADS of seasonal lines; what nonsense is this?

@crackling_rose @bigblackbird66 'Health and Safety gone mad!'
'More Red Tape'

These are the sort of safety features our Government is trying to abolish...

@bigblackbird66 Not right!
Might appeal to humour but Bic pens did not have vented caps in 1955, they had closed, pointed caps.
I'm not sure about 1985.

@SonOfTheWinds The whole idea is to be comfortable, in NO hurry and without stress.
Batch puncture patching is best done on a rainy day, when you're not hankering after going out...
Fresh rubber solution helps. You want it runny...

@ew_presents @fatmanthereturn @hawkins_carole @MichaelRosenYes I opened my 1974 O Level results envelope in the toilet at home.
I was home alone in 1976 for my A Levels so didn't need extra privacy then.
First post arrived at 7.15 am in those days...

@BelindaJOConnor It was entirely normal when I was 13, in 1971.
The sort of thing I did a lot.
The trip to school was over an hour each way and involved walk, tube and bus.

@nysuri @alexelindsay It seems the ISO standard was as late as 1993.
At some point Bic's own FAQ alludes to the ventedcap.
https://t.co/mxcEY6iMID

@nysuri @alexelindsay Ventilated pen caps were mandated (by the 'nanny state') some time around 1980,
Kids still died from inhaled pen caps when I was at school...
My Bics dry out and stop working as a result.

@Oldboatie We have had similar in NW London.
We've had some rain but nothing I'd call 'serious rain'.
Which we need.

@LouisOneDay My grandmother: b 1898, d 1999.
My great-grandmother, born before 1880 ? 1878, d 1967.
Many old people from my Sixties childhood.

@nysuri I've been a doctor for 40 years. I qualified debt-free and started work with 104 hour weeks.
I didn't think about money because there was enough and more.
If I were 40 years younger I'd be thinking about money all the time because I would not have enough...

@SarahInbarnet @Jerrydendrons @Vicktor1111 Hay-ho!
'Where's the spinach?'
Says Anthony Rowley.

@DrRedmile @dgurdasani1 I don't KNOW but would guess a right-wing 'newspaper'.
Current narrative pretends lockdown causes all the grief, not the carnage, caused by Covid.
Politically putting the cart before the horse, big time!

@nysuri My First Class post brown envelope arrived at our home in the 7.15 am morning post. We had two deliveries daily in 1976.
Family was away on holiday.
I had ABB.

@Toneisbackagain Two for a penny?
You are young!
Bless!

@Jontafkasi Harrow has BROWN for this.
Barnet and Brent have green.
I think Brent, Barnet and Harrow all have something blue for recycling but landfill is grey in Brent, black in Barnet and might be green in Harrow. I'll check...

@rob_mcivor @WilliamNB @grantshapps @David_Churchill It's the same story, every fucking Silly Season.
Recurs with the regularity of A Level results.
Tomorrow's 'story'.
&lt;YAWN&gt;

@SueSuezep My mash might contain butter and milk.
Cheesy mash will have cheese.
Poor vegetarian guest declined my potato &amp; carrot mash as he thought carrot bits were prawn...

@HeldinEU I don't want to be rude.
I don't want to make someone feel unwelcome.
Sometimes, I'd like to take an interest in a person's life journey...

@Nedu_MD Many folk lip read subconsciously.
Suggest you are one.
Useful to be able to glance at subtitles...

@AnnaBatchelor Ouch!
I suppose you learned 'ribs heal in three weeks' is fiction...
Hoping you're improving...

@nysuri Happy birthday! (or is this for your Ma?)
My sister had her youngest the day after the 1999 Solar Eclipse, 12 August 1999, which would have been a New Moon.
Brother had demonstrated eclipse to family gathering.

@timspector @FelicityCloake Oh enjoy!
I particularly like croissants with mirabelle jam.
I have a productive mirabelle tree in my garden and make the jam in my microwave...

@MsPottingShed @Jennife10651535 @DrSdeG My colonoscopy was also not to bad but that's just me and I can't speak for anyone else.
Managed on Entonox only, no sedation or other medication.
Preparation was OK: unpleasant, BORING but OK.

@Jennife10651535 @HeldinEU Indeed.
A thoughtful gift is rather better than a thoughtless one.
If I wanted to pack a tiny token, I'd still give more than an isolated fucking teabag...

@HeldinEU @Jennife10651535 Good question!
They have multiple uses.
Pure Gold to a HCW...

@DrLKVaughan There am I, nearly 20 years retired, remembering
that appendicitis presentation in small kids is often atypical and can catch the best out in the worst way.
There, but for the Grace of [Deity] go we all...

@DrSdeG It works the other way too.
Three of my grandparents lived well past 90, without taking formal exercise, though they were active.
Good genes, good housing, good money, good luck...

@UKGastroDr 7 year olds know and understand rules and fairness. Schooling without rules and fairness is nearly impossible.
Shame Boris thinks rules are for others.
Luca appreciates this.

@HonestDrJohn My sister has nine grandchildren.
She is 62 years old.
Is she a grandmother of 9?

@m_p_gibson @juliaisobela I fucked off to a friend's birthday party 200 miles away, when my colleagues told me I needed investigations unavailable for the next 4 days...
No point mooching &amp; moping!
(Blowing an ON over a 4 day BH weekend is not recommended!)

@HeldinEU @woolhatwoman Very strong sense of 'The Show Must Go On' and it's my job to help keep it going.
Most doctors are like that.
Read on Twitter today of doc who finished work before getting appendix out...

@docsuzy Supervised? SUPERVISED?!?!
I was on my own, with the Registrar at the other hospital across town most of the time!
No SHO or SR on our firm...

@25deadbatts @yacfOaky @MikeyCycling I have known you have needed to be ON the zebra crossing to get the traffic to stop, since I was a kid.
I used to put a foot on the crossing while standing on the kerb.
Good that's changed! Always thought having one foot on and one off a bit risky!

@Stuzipants Oh enjoy!
My friend @dannycolyer has just put his son onto an adult uni so they ride better together.
Son is NOT a beginner though...

@pjn151 @trishgreenhalgh Me too!
Enjoyed the session but demoralised by the homicidal, negligent 'pandemic is over' message pushed by the Powers That Be.
In the last month, two parents, two siblings and many other relatives have had Covid.

@doctorcaldwell @mevparekh Indeed but some commercial jam contains glucose syrup.
Read the labels.
Golden syrup and honey are glucose, fructose and sucrose mixtures.

@CatsInFrance @Daily_Express It's not reading and understanding THE RULES wot dun it.
