Now has shitty black UK passport.

@Scotscouser @HeldinEU And moving less...
People eat all the time now but adults hardly ate between meals 50 years ago.
Deep-fried [anything] slathered in syrup is often eaten between meals and is full of fat, sugar and salt...

@eilidh_garrett Get well soon!
My Covid started with the most painful sore throat I had ever experienced.
Please check your 'viral sore throat'!

@EJ_Pharmacist @mark_borthwick @FreseniusKabi A long time ago, ampoules of strong KCl and 0.9% NaCl flush were identical.
Fortunately, I spotted somebody's error when the wrong substance had been drawn up prior to arrival of critical patient...
Form filled...

@mancunianmedic @SheilaMarsh @JaneSymons1 FFS!
I take it these people might be medics!?!
Senior Doctor Empathy Deficit Syndrome - straight out of Four Yorkshiremen sketch...

@mancunianmedic DON'T FRET!
Most will drop off in the next fortnight. It's up to you whether you weigh &amp; watch or just avoid the scales.
Convalescence, heat, travel and feeding DO this!

@DrNeenaJha Our GP's used to have a 'Switch Off Mobiles' sign in the waiting room.
Trouble is phones have so many functions nowadays.
I'm glad I'm not in this situation as I might ask if the patient was consulting me or their phone and make a choice...

@WilliamNB Hard luck mate!
Hope meds kick in soon!
Keep well-hydrated, always!

@ralanshirley 34 years ago, I was a medical SHO. JHO &amp; I had parturient sisters abroad.
My sister had massive PPH &amp; survived.
HO's sister had massive PPH and did not...

@kiityc @birthrightsorg PARACETAMOL post C-section FFS!
