We really ought to do better!

@jfparis @MikeyCycling @carltonreid Sounds fair.
I think I'd want credit if it were me but I post only for me.
Commercial companies stealing other folks' work is still theft...

@RoshanaMN Mine doesn't.
Brother used to fill old Fairy Liquid bottle with water, hold it between legs and squeeze, as kid.
Maybe there's some psychology there...

@drruthannharpur @FeedingAlliance @TheGrocer @1stepsnutrition Sounds fair.
Post-partum samples might not encourage breast-feeding in those with any doubts or difficulties though.
I believe breast can be best but there are loads of reasons for formula and I won't judge mothers...

@drruthannharpur @FeedingAlliance @TheGrocer @1stepsnutrition I think the balance is about right in the UK.
That's not always the case in other nations.
Saw a tweet yesterday describing ?USA free formula sample dump received by someone who'd bought a pregnancy test.

@eilidh_garrett Doctors have always bought washing machines!
I lived in hospital accommodation, with available laundry facilities for much of my career and only bought a machine when I bought my house.
Few doctors 'live in' nowadays.

@HeldinEU I'm in London and 2nd Class usually arrives within 3 days.
I seldom bother with 2nd Class; I'm usually spoilt enough to hope it arrives sooner for the extra 27p.
What's the cheapest domestic stamp in Germany?

@joebloggsuk1 My reaction would be NO, NO &amp; thrice NO
+ report to authorities.
Unacceptable, inappropriate and unethical.

@WilliamNB Kidney stones are known to be extremely painful!
Dehydration makes them more likely.
Keep up the water intake and get well soon!

@Jopo_dr The verb 'to break' in Latin conjugates with 'frango' and 'fractum' doesn't it?
Fragile is another derivative
I did little Latin, mind!

@BrainJumble That someone is a BASTARD!
Something hand-crafted shows great generosity and fudge is lovely.
Don't let the buggers grind you down!

@estrellasadie @CordeliaAppleb1 Childcare for working parents.
Any 'education' is a bonus!
Some parents do rely on this, to be fair.

@HeldinEU So do I!
Sister-in-law drinks nothing else.
We indulge when away from home but have 4 x 2 litre bottles of supermarket cheapest for when there's nowt in taps, as happens. We have no tanks with Fucking Modern Plumbing.

@trishgreenhalgh Top breeders recommend it because it's SOLID nourishment. &lt;THUMP!&gt;
ENJOY!
