@ross_moy I was hot in the Sahara but the heat was dry so my perspiration was effective.
I am hot in London and my perspiration is less effective.
I also lose less heat through breathing...

@Christiane HOW many wheelchair-accessible toilets does London's largest railway station have?
ONE!
Access can be rubbish...

@nysuri @Dr_Claire_B @Andywebster @BellaRoscetti I believe there Geordie mnemonic for that: 
I I Y I...

Aye aye why aye...

@ChrisMaslanka I have two siblings in Jerusalem.
They really miss English fruit that's unavailable there.
Visiting brother went WILD for my blackberries and sister was SO nostalgic for Bramleys!

@galleonskip ..and what if this kid with a TOTALLY BROKEN childhood had turned to crime, as happens?
Would he be deported?
To where?

@DrNeenaJha The innocent logic!
He'll get disappointed with rule-breakers soon...
He might scream or cry...

@CTG2011 @VoleOSpeed So do I!
