Bike theft is very low on police priority.

@Dr_Claire_B @Jopo_dr @jfdwolff Sometimes all this physics &amp; physiology is vaguely fun and useful.
Extremities have a blood flow well in excess of physiological need. They are counter current heat exchangers. Use as a heat sink.
Chill yourself by dipping extremity in cold water for a few minutes.

@jfdwolff @Dr_Claire_B Humidity and air movement.
Conditioned air has inbuilt wind chill (= forced convection/evaporative cooling).
High humidity reduces evaporative cooling.

@saspist Thanks!
She sounded OK on phone a few minutes ago. She's TOUGH 86, no medication.
Dad OTOH is 91 and very frail - bed-bound with round-the-clock care.

@nysuri Broken kid with TOTALLY broken childhood makes good.
Let's begrudge his astounding success.
Because we are nasty racist bigots.

@anjibennett I didn't want a cat. Partner did.
Cats moved into our abode. Partner found nest of cats &amp; kittens in our shed.
Which forced matters.

@Hopkins_Alison @lorrainemking Our 'whole school' photo was taken in similar weather on 1 July 1972.
Everyone *had* to wear a jumper, cardigan or blazer.
I had come to school without these and was pictured in a blazer from the school's 2nd hand uniform shop.

@rogermerriman @ShivaniM_KC Some banking authorisation.
Other apps.
I'm mostly housebound so mobile data is a costly waste, when my home Wifi is fine.

@rogermerriman @ShivaniM_KC Probably brainstem, where I've had much demyelination.
My eyes fix &amp; move fine and my balance seems OK though it's hard to judge as I'm so weak.
I really don't want to be forced to have smartphone!

@rogermerriman @ShivaniM_KC I'm dyspraxic and now have a numb, weak right dominant hand.
Unable to hold a pen since ?2004.
No longer a problem but smart phone lack is becoming an issue.

@rogermerriman @ShivaniM_KC Faceblindness is socially awkward in a way other impairments aren't.
I don't have an iPad/iPhone as I can't use a touchscreen.
This is beginning to be quite a handicap!

@DrBenLovell Love your 'cold swear' typo.
We have a wide patio door.
Sofa was delivered too long ago for me to recall how it entered.

@rogermerriman @ShivaniM_KC I don't have a brain injury.
Methinks faceblindness varies HUGELY between people.
I think I'm average &amp; some friends are much better, some much worse than me.

@bigblackbird66 I am a white, Jewish female wheelchair user.
Twitter has awakened me to racist behaviour I have adopted in the past and hope to have corrected now.
It's nice to connect with other disabled folk, which is good.

@BikingTrev @onepoint618 @4ChordsNoNet @cyclegaz Paper banknotes have been phased out in the UK.
I don't think they can be used in shops any more and the £20 won't even be exchangeable in banks soon.
All banknotes in common UK circulation are now plastic.

@chrischirp ANY airport that fails in some respect or makes a traveller feel bad, without immediate useful remedy, is The Worst that day.
A smooth, swift, pleasant experience will make it The Best.
'Horrible' airports have been 'Fine' on other trips..

@michaelryan756 I visited Mum (86) &amp; Dad (91) last Wednesday. Mum asked me to remove mask.
Sister (unmasked) also came round. She tested positive next day.
I sit and worry...

@RDavidUrology @RCSEd Nicholson Street Old Boys' Drinking Club!
Congratulations!
Welcome and Call me Sir... https://t.co/Zg1AZZVVol

@mancunianmedic Former schoolmate remarked the Head looked so *young* on a school picture shared on Facebook.
I pointed out I calculated his age as 40 on the photo.
We are in our 60s...

@dr_shibley Well, probably.
I don't know if Suella was born in the UK.
She grew up in Wembley, where there are many of Goan origin.

@nysuri I'm childless and torn.
If this was in the context of Christmas rotas, I can see why those with kids might get prioritised.
But I don't celebrate Christmas either...

@CyclingInASkirt It's quite a climb, I seem to recall.
You really don't want to dismount here - you'll never get going again!
(I'm a medic, who lived on Collegiate Crescent in the late '70s.)

@Andywebster @juliaisobela @matthew_sctt To be fair, in the Bad Old Days staff were horrible to self-harm patients.
