(I retired 18 years ago so nobody will be harmed by me now.)

@gnomeicide Cherry plums I just leave the stones and spit them out when the time comes.
Our tree has VICIOUS thorns!
Victoria plums get stones (and moth detritus) removed.

@MumbrianSpinner @diddlywiddly @YorkshireTea And a jug of hot water.
And a milk jug.
Please!

@SirWobbly @maturecheddar1 Partner's woven cotton boxers are just about decent as sole attire so he's sorted.
