Thankfully!

@nysuri I also think it was nothing like so pricy!
I have no idea how much it cost, who bought it or when.
It featured in innumerable family gatherings until her 101st birthday - so many teatimes, birthdays and meals!

@DrSelvarajah Get Well Soon!
I have two affected siblings, one nephew, very low lymphocytes and Ancient Parents.
I am sh*t scared!

@Dawn_Galway Congratulations!
The felling of freedom is wonderful!
(I've been mortgage-free since 2004.)

@Jennife10651535 @theveindoc I presume it's a smart toilet, that ablutes after you void.
