Therapeutic for the injured perineum.

@nysuri Let it wait.
REST!
Nobody ever died from domestic chores undone!

@galleonskip 'I'm sorry you feel [whatever]' is the ultimate non-apology.
I confess I used it
in response to a complaint I'd eaten Quality Street on Christmas Day...

@drandmum @BorisJohnson @Parody_RCGP Some folk are blind/deaf/insensitive to hints and cues.
Some describe this as a disorder.
I still don't know what to do with guests who stay after all the others have left...

@Jontafkasi We paid £2.5k for just a fence 6 years ago.
Posts are good.
Wood is crap and has shrunk, leaving gaps.

@pepemac27 I am relieved to inform you that our family motto is
'Let them win!'
I'm a useless sportsperson but still have a full and fulfilled life.

@juliaisobela I get very wound-up about not being ready for anything in good time.
My disabilities limit the speed at which I can dress or toilet, so I allow plenty of time for everything.
I get pretty anxious about going out but I'm almost never late or unready.

@juliaisobela Some folk have have much more accurate sense of time than others.
I'm generally very conscious of the time &amp; constantly look at timepieces.
There are wall clocks everywhere in my home. Not all faces have numerals. Phones &amp; computers display digital time. I don't wear a watch.

@juliaisobela I think this is true for many younger people.
In contrast, I DEMANDED to be taught to do this when I was 4 and mastered it fast.
Different times, different clocks!

@ChemNorfolk [Old Woman mode]
We never had proms in My Day.
Pricy American import!

@theousherwood @rachaelvenables @mrjamesob @RoyalLondonHosp Get Well Soon!
